import React, {Component} from 'react'


export default class UserCreate extends Component {
    constructor(props){
        super(props);

        this.onChangeUsername = this.onChangeUsername.bind(this)
        this.onChangePassword = this.onChangePassword.bind(this)
        this.onChangeUsername = this.onChangeUsername.bind(this)
        this.onChangeUsername = this.onChangeUsername.bind(this)
        this.onChangeUsername = this.onChangeUsername.bind(this)

        this.state =
        {
            username: '',
            password: '',
            description: '',
            typeOfGamer: ''

        }
    }

    onChangeUsername(e){
        this.setState({
            username: e.target.value
        })
    }

    onChangePassword(e){
        this.setState({
            password: e.target.value
        })
    }

    onChangeDescription(e){
        this.setState({
            description: e.target.value
        })
    }

    onChangeTypeOfGamer(e){
        this.setState({
            typeOfGamer: e.target.value
        })
    }

    onSubmit(e){
        e.preventDefault()
        const User ={
            username: this.state.username,
            password: this.state.password,
            description: this.state.description,
            typeOfGamer: this.state.typeOfGamer
        }
        console.log(User)
    }



    render(){
        return(
            <div className="container">
                <form>
                    <div className="form-group">
                        <label for="exampleInputEmail1">Username</label>
                        <input type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter username" />
                        <small id="emailHelp" className="form-text text-muted">Make a unique username</small>
                    </div>
                    <div className="form-group">
                        <label for="exampleInputPassword1">Password</label>
                        <input type="password" className="form-control" id="exampleInputPassword1" placeholder="Password" />
                    </div>
                    <div className="form-group">
                        <textarea className="form-control" name="" id=""rows="3"></textarea>
                        <small className="form-text text-muted">Enter a Description about yourself!</small>
                    </div>
                    <div className="form-group">
                    <select name="" id="" className="form-control form-control-s">
                        <option >Casual</option>
                        <option >HardCore</option>
                        <option >Semi-Casual/HardCore</option>
                    </select>
                    </div>

                    <input type="submit" value="Submit"  className="btn btn-primary" />
                    </form>
            </div>
        )
    }

}
